export const styles = theme => ({
    root: {
        background: "transparent",
        bottom: 0,
        display: "block",
        left: 0,
        opacity: ".8",
        position: "fixed",
        right: 0,
        top: 0,
        zIndex: theme.level.content,
    },
});
